function App_Retreat_Render_Data_Radio(n,t,i,r){let u="",f=0;while(t<=i){let i=f*_distance_multi,o=t==n?'checked="checked"':"",s=ConvertDT_To_ThousandNumber(new Date),e=t<s?"disabled":"",h='<span class="_text_radio '+e+'" style="left:'+i+'px">'+ConvertThousandNumber_To_MY(t)+'<\/span><div class="ui radio checkbox _check_radio" style="left:'+(i+9)+'px"><input type="radio" class="radio_choose" name="radio" '+o+" data-value="+t+" data-id="+r+" data-default="+n+" "+e+'><label class="coloring red"><\/label><\/div>';u=u+h;t=t+1;f++}return u}function App_Retreat_Render_Data_TimeLine_Current(n,t,i,r){let e=(i-t)*_distance_multi,o=(r-i)*_distance_multi+13,f='<div class="retreat_appointment_current_line" style="position:absolute;width:'+o+"px;left:"+(e+9)+'px"><\/div>';for(var u=0;u<n.length;u++){let e=n[u],o=Number(n[u].IsDisable),s=ConvertDT_To_ThousandNumber(e.Date_From),i=(s-t)*_distance_multi,r="";r=o==1?'<div class="retreat_appointment_sticky_disable" style="position:absolute;left:'+(i+9)+'px"><\/div>':'<div class="retreat_appointment_sticky" style="position:absolute;left:'+(i+9)+'px"><\/div>';f=f+r}return'<div class="retreat_appointment_sticky_container">'+f+"<\/div>"}function App_Retreat_Render_Data_TimeLine(n,t,i,r){let e="",u=n.filter(n=>Number(n.IsDisable)==0);if(u!=undefined){for(var f=0;f<u.length;f++){let r=u[f],n=ConvertDT_To_ThousandNumber(r.Date_From);f==0&&(t=n);let o=(n-i)*_distance_multi,s='<div class="retreat_appointment" style="position:absolute;left:'+(o+9)+'px"><\/div>';e=e+s}let n=ConvertDT_To_ThousandNumber(u[u.length-1].Date_From)-ConvertDT_To_ThousandNumber(u[0].Date_From),o=(t-i)*_distance_multi;return'<div id="retreat_appointment_container_'+r+'" class="retreat_appointment_container" data-value=0>'+e+'<div id="retreat_appointment_new_line_'+r+'" class="retreat_appointment_new_line" style="width:'+n*_distance_multi+"px;left:"+(o+13)+'px;"><\/div><\/div>'}}function App_Retreat_Render_Data(n,t,i){var r=document.getElementById(i);if(r!=null){let r="";if(n&&n.length>0){let f=ConvertDT_To_ThousandNumber(n[0].Date_From),o=ConvertDT_To_ThousandNumber(n[n.length-1].Date_From),e=f-3,s=o+16,u=n.filter(n=>Number(n.IsDisable)==0);if(u!=undefined&&u.length!=0){let h=ConvertDT_To_ThousandNumber(u[0].Date_From);r=App_Retreat_Render_Data_Radio(h,e,s,t);r=r+App_Retreat_Render_Data_TimeLine(u,f,e,t);r=r+App_Retreat_Render_Data_TimeLine_Current(n,e,f,o);document.getElementById(i).innerHTML=document.getElementById(i).innerHTML+'<div class="ui segment app_retreat_list_content">'+r+"<\/div>"}}}App_Retreat_Event()}